import React, { useEffect, useState } from 'react';
import { Scale, Star, Gavel, BookOpen, FileText, Award, Check, Users } from 'lucide-react';

const DynamicBanner = () => {
  const [mousePosition, setMousePosition] = useState({ x: 0, y: 0 });
  const [isVisible, setIsVisible] = useState(false);

  useEffect(() => {
    setIsVisible(true);
    
    const handleMouseMove = (e) => {
      setMousePosition({
        x: (e.clientX - window.innerWidth / 2) / 50,
        y: (e.clientY - window.innerHeight / 2) / 50
      });
    };

    const styles = `
@keyframes float {
  0%, 100% { transform: translateY(0) rotate(0deg); }
  50% { transform: translateY(-20px) rotate(5deg); }
}

@keyframes slide-right {
  0% { transform: translateX(-100%); }
  100% { transform: translateX(100%); }
}

@keyframes slide-left {
  0% { transform: translateX(100%); }
  100% { transform: translateX(-100%); }
}

@keyframes gradient {
  0% { background-position: 0% 50%; }
  50% { background-position: 100% 50%; }
  100% { background-position: 0% 50%; }
}

@keyframes twinkle {
  0%, 100% { opacity: 0.2; transform: scale(1); }
  50% { opacity: 0.7; transform: scale(1.2); }
}

.animate-float {
  animation: float 6s ease-in-out infinite;
}

.animate-slide-right {
  animation: slide-right 3s linear infinite;
}

.animate-slide-left {
  animation: slide-left 3s linear infinite;
}

.animate-gradient {
  animation: gradient 15s ease infinite;
  background-size: 400% 400%;
}

.animate-twinkle {
  animation: twinkle 3s ease-in-out infinite;
}
`;

    window.addEventListener('mousemove', handleMouseMove);
    return () => window.removeEventListener('mousemove', handleMouseMove);
  }, []);

  const features = [
    { text: "Avalie", icon: Star, delay: 0 },
    { text: "Contribua", icon: FileText, delay: 0.2 },
    { text: "Ganhe Benefícios", icon: Award, delay: 0.4 }
  ];

  return (
    <div className="w-full h-[32rem] relative overflow-hidden bg-gradient-to-r from-blue-900 via-indigo-900 to-blue-900">
      {/* Animated gradient background */}
      <div 
        className="absolute inset-0 bg-gradient-to-r from-blue-500/10 via-indigo-500/10 to-blue-500/10 animate-gradient"
      />

      {/* Floating background elements */}
      <div className="absolute inset-0">
        {/* Larger background icons */}
        {[Scale, Gavel, BookOpen, Users].map((Icon, index) => (
          <Icon
            key={index}
            className="absolute text-white/5 w-24 h-24 animate-float"
            style={{
              top: `${15 + (index * 20)}%`,
              left: `${10 + (index * 25)}%`,
              animationDelay: `${index * 1.5}s`,
              transform: `translate(${mousePosition.x}px, ${mousePosition.y}px) rotate(${index * 45}deg)`,
              transition: 'transform 0.3s ease-out'
            }}
          />
        ))}

        {/* Animated stars */}
        {[...Array(8)].map((_, i) => (
          <Star
            key={i}
            className="absolute text-yellow-500/20 w-6 h-6 animate-twinkle"
            style={{
              top: `${Math.random() * 80}%`,
              left: `${Math.random() * 80}%`,
              animationDelay: `${i * 0.7}s`,
              transform: `translate(${mousePosition.x * 0.5}px, ${mousePosition.y * 0.5}px)`,
              transition: 'transform 0.3s ease-out'
            }}
          />
        ))}
      </div>

      {/* Main content with parallax effect */}
      <div 
        className="relative z-10 w-full h-full flex flex-col items-center justify-center px-4 text-center"
        style={{
          transform: `translate(${mousePosition.x * -0.2}px, ${mousePosition.y * -0.2}px)`,
          transition: 'transform 0.3s ease-out'
        }}
      >
        <h1 
          className={`text-5xl font-bold text-white mb-6 transform transition-all duration-1000 ${
            isVisible ? 'translate-y-0 opacity-100' : '-translate-y-20 opacity-0'
          }`}
        >
          Bem vindo ao Justix!
        </h1>
        
        <div 
          className={`max-w-3xl transform transition-all duration-1000 delay-300 ${
            isVisible ? 'translate-y-0 opacity-100' : 'translate-y-20 opacity-0'
          }`}
        >
          <p className="text-xl text-white/90 leading-relaxed mb-8">
            Aqui você não apenas compartilha sua opinião sobre ações jurídicas você também é recompensado por isso!
            Avalie, contribua com suas análises e adquira isenção de custo no seu próximo processo ao alcançar metas de avaliações.
          </p>
        </div>

        {/* Animated features */}
        <div className="flex gap-8 mt-4">
          {features.map((feature, index) => (
            <div
              key={index}
              className={`flex flex-col items-center transform transition-all duration-1000 ${
                isVisible 
                  ? 'translate-y-0 opacity-100' 
                  : 'translate-y-20 opacity-0'
              }`}
              style={{ transitionDelay: `${800 + feature.delay * 1000}ms` }}
            >
              <feature.icon className="w-10 h-10 text-blue-300 animate-bounce" style={{ animationDelay: `${feature.delay}s` }} />
              <span className="text-white mt-2">{feature.text}</span>
            </div>
          ))}
        </div>

        {/* Animated bars */}
        <div className="absolute bottom-0 w-full space-y-1">
          <div className="h-1 bg-blue-500/20">
            <div className="h-full bg-blue-400 animate-slide-right" />
          </div>
          <div className="h-1 bg-blue-500/20">
            <div className="h-full bg-blue-300 animate-slide-left" />
          </div>
        </div>
      </div>
    </div>
  );
};

export default DynamicBanner;
